from typing import List

class Solution:
    def kthSmallestProduct(self, nums1: List[int], nums2: List[int], k: int) -> int:
        """
        will results in TLE QQ
        """
        import math
        import bisect
        from functools import cache
        nums1_pos, nums1_neg = [], []
        nums2_pos, nums2_neg = [], []
        # for n in nums1: 
        #     if n > 0: 
        #         nums1_pos.append(n)
        #     else: 
        #         nums1_neg.append(n)
        
        # for n in nums2: 
        #     if n > 0: 
        #         nums2_pos.append(n)
        #     else: 
        #         nums2_neg.append(n)

        nums1.sort()
        nums2.sort()
        pidx1 = len(nums1) 
        pidx2 = len(nums2)
        for i, n in enumerate(nums1):
            if n > 0: 
                pidx1 = i 
                break 
        
        for i, n in enumerate(nums2):
            if n > 0: 
                pidx2 = i 
                break 
        
        nums1_pos, nums1_neg = nums1[pidx1: ], nums1[: pidx1]
        nums2_pos, nums2_neg = nums2[pidx2:], nums2[: pidx2]
        # n_pos = len(nums1_pos) * len(nums2_pos) + len(nums1_neg) * len(nums2_neg)
        n_neg = len(nums1_pos) * len(nums2_neg) + len(nums1_neg) * len(nums2_pos)
        # import pdb 
        # pdb.set_trace()
        def _bisect_left(val, lst, inc=True): 
            l, r = 0, len(lst) - 1 
            while l < r: 
                mid = (l + r) // 2 
                cond = lst[mid] >= val if inc else lst[mid] <= val
                if cond: 
                    r = mid 
                else: 
                    l = mid + 1 
            return l
        def _bisect_right(val, lst, inc=True): 
            l, r = 0, len(lst) - 1 
            while l < r: 
                mid = (l + r + 1) // 2 
                cond = lst[mid] <= val if inc else lst[mid] >= val
                if cond: 
                    l = mid 
                else: 
                    r = mid - 1 
            return l
        
        if k > n_neg: 
            # nums1_pos.sort()
            # nums1_neg.sort(key=lambda x: -x)
            # nums2_pos.sort()
            # nums2_neg.sort(key=lambda x: -x)
            
            nums1_neg.reverse()
            nums2_neg.reverse()

            k -= n_neg 
            if len(nums1_pos) == 0 or len(nums2_pos) == 0: 
                lv = nums1_neg[0] * nums2_neg[0] 
                rv = nums1_neg[-1] * nums2_neg[-1] 
            elif len(nums1_neg) == 0 or len(nums2_neg) == 0: 
                lv = nums1_pos[0] * nums2_pos[0] 
                rv = nums1_pos[-1] * nums2_pos[-1] 
            else:
                lv, rv = min(nums1_pos[0] * nums2_pos[0], nums1_neg[0] * nums2_neg[0]), \
                            max(nums1_pos[-1] * nums2_pos[-1], nums1_neg[-1] * nums2_neg[-1])
           
            ub = math.ceil(math.log2(rv)) + 1 if rv > 0 else math.ceil(math.log2(10 ** 10))
            def count(prod, lst1, lst2): 
                if len(lst1) == 0 or len(lst2) == 0: 
                    return 0
               
                def count_num(mul): 
                    l, r = 0, len(lst2) 
                    while l < r: 
                        mid = (l + r) // 2

                        if mul * lst2[mid] <= prod: 
                            l = mid + 1
                        else: 
                            r = mid
                    return l
                acc = 0
                tmp = None
                for n in lst1: 
                    if tmp != n:
                        cnt = count_num(n)
                    tmp = n
                    acc += cnt
                    if cnt == 0: 
                        break 
                return acc 
            
            for _ in range(ub): 
                mid = (lv + rv) / 2 
                if count(mid, nums1_pos, nums2_pos) + count(mid, nums1_neg, nums2_neg) >= k: 
                    rv = mid 
                else: 
                    lv = mid
            return int(rv)
        else: 
            # nums1_pos.sort(key=lambda x: -x)
            # nums1_neg.sort()
            # nums2_pos.sort(key=lambda x: -x)
            # nums2_neg.sort()
            
            nums1_pos.reverse()
            nums2_pos.reverse()

            if len(nums1_pos) == 0 or len(nums2_neg) == 0: 
                lv = nums1_neg[0] * nums2_pos[0] 
                rv = nums1_neg[-1] * nums2_pos[-1] 
            elif len(nums1_neg) == 0 or len(nums2_pos) == 0: 
                lv = nums1_pos[0] * nums2_neg[0] 
                rv = nums1_pos[-1] * nums2_neg[-1] 
            else:
                lv, rv = min(nums1_pos[0] * nums2_neg[0], nums1_neg[0] * nums2_pos[0]), \
                            max(nums1_pos[-1] * nums2_neg[-1], nums1_neg[-1] * nums2_pos[-1])
    
            ub = math.ceil(math.log2(abs(lv))) + 1 if lv < 0 else math.ceil(math.log2(10 ** 10))
            def count(prod, lst1, lst2): 
                if len(lst1) == 0 or len(lst2) == 0: 
                    return 0
        
                def count_num(mul): 
                    # tmp = prod / mul
                    l, r = 0, len(lst2) 
                    while l < r: 
                        mid = (l + r) // 2 
                        # inc = lst2[0] < 0
                        # midl = _bisect_left(lst2[mid], lst2, inc)
                        # midr = _bisect_right(lst2[mid], lst2, inc)
                        if mul * lst2[mid] <= prod: 
                            l = mid + 1
                        else: 
                            r = mid
                    return l
                acc = 0
                tmp = None
                for n in lst1: 
                    if tmp != n: 
                        cnt = count_num(n)
                    tmp = n
                    acc += cnt
                    if cnt == 0: 
                        break 
                return acc 
            
            for _ in range(ub): 
                mid = (lv + rv) / 2 
                if count(mid, nums1_pos, nums2_neg) + count(mid, nums1_neg, nums2_pos) >= k: 
                    rv = mid 
                else: 
                    lv = mid
            # print(lv, rv)
            return int(lv)

    def kthSmallestProduct1(self, nums1, nums2, k): 
        """
        just for testing
        """
        tmp = []
        for n1 in nums1: 
            for n2 in nums2: 
                tmp.append(n1 * n2)
        tmp.sort()

        return tmp[k - 1]

